INSERT INTO `services` (`id`, `name`, `controller`, `view`, `image`, `details`, `price`, `status`) VALUES
(1, 'Scaling and Polishing', 'ScalingandPolishing', 'scalingandpolishing', , 'Despite our best efforts, brushing twice a day does not remove all the plaque in our mouths, plaque that remains in the mouth will eventually harden and form calculus or tartar. Manual tooth brushing will not be able to remove this tartar and it must be removed by the dentist only.\r\n\r\nScaling and polishing routinely once or twice annually improves oral health thus help us to prevent gum (Periodontal) disease that can lead to tooth lost. After scaling, we will polish off your teeth with polishing paste containing fluoride for extra protection. Surface stains from coffee, tea, red wine or tobacco use are also cleaned away during polishing. Do visit nearby clinic for proper scaling and polishing consultation and treatment.', '50', 'show');
INSERT INTO `services` (`id`, `name`, `controller`, `view`, `image`, `details`, `price`, `status`) VALUES
(2, 'Teeth Whitening', 'TeethWhitening', 'teethwhitening', , 'Professional, in-office teeth whitening is the most popular cosmetic dental procedure in the world today. It takes place under carefully monitored conditions which allow for the safe, controlled, pain-free use of a relatively high concentration of bleaching gel – yielding results that are visible (up to 8 shades) and immediately (in 1 hour).\r\n\r\nTooth whitening can last for one or more years, depending on how well you take care of your teeth, and if you’re following up regularly with a home whitening product for regular maintenance.', '70', 'show');
INSERT INTO `services` (`id`, `name`, `controller`, `view`, `image`, `details`, `price`, `status`) VALUES
(3, 'Dental Veneers', 'DentalVeneers', 'dentalveneers', , 'Are you afraid to smile? Embarrassed about your teeth? Or maybe you just want a better looking smile. Recapturing the beauty of your smile is easier than you think. Dental veneers, the primary smile enhancement, is used in extreme makeovers and can dramatically improve the appearance of your teeth.\r\n\r\nDental veneers are wafer-thin, custom-made shells of tooth-colored materials designed to cover the front surface of teeth to improve your appearance. These shells are bonded to the front of the teeth changing their color, shape, size or length.', '1000+', 'show');

